import React, { Component } from 'react';
import ResponsiveDrawer from './Layout';
import CircularProgress from '@material-ui/core/CircularProgress';
class IndexTutorial extends Component {

  constructor(props){
    super(props)
    this.state={
      tutorialIndex:[],
      tutoName:'',
      imageIcon:'',
      loading:true
    }
  }



  componentDidMount(){
    const api='/api';
    let res='';
    switch(this.props.match.path){
      case '/react':
        res = api.concat('/react');
        this.setState({
          tutoName:'React',
          imageIcon:'data:image/png;base64,'
        })
        break;
      case '/redux':
           res = api.concat('/redux');
           this.setState({
             tutoName:'Redux',
             imageIcon:'data:image/png;base64,'
           })
          break;
      default:
        return null;
    }
    fetch("https://tutorialweb-backend.herokuapp.com"+res)
      .then(res=>res.json())
      .then(response=>this.setState({
        tutorialIndex:response,
        loading:false
      }));


  }


  render() {
    console.log('state imageIcon',this.state.imageIcon);
    return (
      <div style={{position:'relative'}}>
      {
        this.state.loading
        ?
        <CircularProgress style={{position:"absolute",top:'250px'}}/>
        :
        <ResponsiveDrawer
          imageIcon={this.state.imageIcon}
         tutoName={this.state.tutoName}
         tutorialIndex={this.state.tutorialIndex}
         />
      }




      </div>
    );
  }
}

export default IndexTutorial;
